webpackJsonp([0xad2c488e6d9],{5308:function(t,e){t.exports={data:{post:{html:"<p>Most days, spending time alone with my son is a rewarding experience. Today was not one of them. Mama is out of town until Friday night, so I'm working both early and late (parental) shifts. This evening, Christopher cried for 90 minutes straight. Not the stubborn 'I want my way' cry, or the familiar 'feed me now' cry. Even in the bath he cried. I don't what he was trying to say. Maybe he was just tired. I ended up putting him to bed early, skipping supper. I have no idea whether that was right or wrong. Right now, <i>I'm</i> tired.</p>",fields:{title:"Video Killed the Radio Star",date:"01 Aug 2001",url:"https://papascott.de/2001-08-01-video-killed-the-radio-star/"}}},pathContext:{slug:"/2001-08-01-video-killed-the-radio-star/",prev:{fields:{title:"Short Circuit",date:"31 Jul 2001",slug:"/2001-07-31-short-circuit/"}},next:{fields:{title:"Mouse that Roared",date:"02 Aug 2001",slug:"/2001-08-02-mouse-that-roared/"}}}}}});
